import UserContext from '../UserContext';
import './Home.scss';

const Home = (props) => {
    const { isAuth, profile } = useContext(UserContext);
    return (
        <section className="hero tinted-image is-fullheight-with-navbar">
            <div className="hero-body">
                <div className="container has-text-centered">

                    <p className="has-text-white is-size-1 title-secondary">WELCOME TO TASK-MANAGER</p>
                    <p className="p-b-lg has-text-light is-size-5">Manager helps teams collaborate easlly. Try us!</p>
                    <button className="button is-info">
                        <span className="icon">
                            <i className="fas fa-bars"></i>
                        </span>
                        <button className="button">Create New List</button>
                    </button>
                </div>
            </div>
        </section>

    )
}

export default Home
